    TRY_DECL(bindings, NewLexicalScopeData(cx_, currentScope, alloc_, parseContext_));
    TRY_DECL(result, factory_.newLexicalScope(*bindings, body));
    TRY(factory_.setupCatchScope(result, binding, body));return result;
